new Promise(((e,l)=>{projectsHome?e():l("Filters element do not exist")})).then((e=>{for(let e of projectsHome)document.getElementById("grid").innerHTML+='    <article class="c-cell c-cell--lg u-radius">      <div class="c-cell__info">        <header class="c-cell__header">          <h3 class="c-cell__title">            <a class="js-link--content c-cell__link"            href="'+e.href+'"            aria-label="'+e.label+'"            data-template="'+e.templatePath+'"            target="_top">'+e.name+'</a>          </h3>        </header>        <footer class="c-cell__footer">          <ul id="badge-'+e.id+'" class="l-list"></ul>          <p>'+e.desc+'</p>        </footer>      </div>      <figure class="c-cell__fig">        <img src="'+e.img+'" alt="'+e.imgAlt+'" class="c-cell__img">      </figure>    </article>',moduleViewRenderer.getViewBadges(e.themes,document.getElementById("badge-"+e.id))}),(e=>{})).finally((()=>{moduleRouter.linksListener("js-link--content")}));